import React, { useState, useEffect } from "react";
import axios from "axios";
import { useNavigate } from "react-router-dom";

const Employee = () => {
  const [id, setId] = useState("");
  const [name, setName] = useState("");
  const [password, setPassword] = useState("");
  const [role, setRole] = useState("");
  const [employeeList, setEmployeeList] = useState([]);
  const navigate = useNavigate();

  useEffect(() => {
    viewEmployees();
  }, []);

  const viewEmployees = async () => {
    try {
      const response = await axios.get("http://localhost:5050/api/employees");
      setEmployeeList(response.data);
    } catch (error) {
      console.error("Failed to fetch employees:", error);
    }
  };

  const addEmployee = async () => {
    try {
      await axios.post("http://localhost:5050/api/employees", {
        employeename: name,
        employeepassword: password,
        employeetype: role,
      });
      alert("✅ Employee added successfully!");
      viewEmployees();
    } catch (error) {
      console.error("Failed to add employee:", error);
    }
  };

  const updateEmployee = async () => {
    try {
      await axios.put(`http://localhost:5050/api/employees/${id}`, {
        employeename: name,
        employeepassword: password,
        employeetype: role,
      });
      alert("✅ Employee updated successfully!");
      viewEmployees();
    } catch (error) {
      console.error("Failed to update employee:", error);
    }
  };

  const deleteEmployee = async () => {
    try {
      await axios.delete(`http://localhost:5050/api/employees/${id}`);
      alert("✅ Employee deleted successfully!");
      viewEmployees();
    } catch (error) {
      console.error("Failed to delete employee:", error);
    }
  };

  return (
    <div>
      <h2>Employee Management</h2>
      <div>
        <input
          type="text"
          placeholder="Employee ID"
          value={id}
          onChange={(e) => setId(e.target.value)}
        />
        <input
          type="text"
          placeholder="Employee Name"
          value={name}
          onChange={(e) => setName(e.target.value)}
        />
        <input
          type="password"
          placeholder="Employee Password"
          value={password}
          onChange={(e) => setPassword(e.target.value)}
        />
        <input
          type="text"
          placeholder="Employee Role"
          value={role}
          onChange={(e) => setRole(e.target.value)}
        />
        <div>
          <button onClick={addEmployee}>Add Employee</button>
          <button onClick={updateEmployee}>Update Employee</button>
          <button onClick={deleteEmployee}>Delete Employee</button>
        </div>
      </div>

      <div>
        <h3>Employee List</h3>
        <table border="1" style={{ width: "100%" }}>
          <thead>
            <tr>
              <th>Employee ID</th>
              <th>Employee Name</th>
              <th>Role</th>
            </tr>
          </thead>
          <tbody>
            {employeeList.map((employee) => (
              <tr key={employee.employeeid}>
                <td>{employee.employeeid}</td>
                <td>{employee.employeename}</td>
                <td>{employee.employeetype}</td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>

      <button style={{ marginTop: "20px" }} onClick={() => navigate("/manager")}>
        ⬅️ Back to Manager
      </button>
    </div>
  );
};

export default Employee;
